import React, { Component } from "react";
import Navbar from "../components/layouts/navbar";
import {
  Accordion,
  AccordionItem,
  AccordionItemHeading,
  AccordionItemPanel
} from "react-accessible-accordion";
import "react-accessible-accordion/dist/fancy-example.css";

const ShowContent = ({ title, content }) => {
  return (
    <React.Fragment>
      <div className="title">{title}</div>
      <div className="content">
        <p>{content}</p>
      </div>
    </React.Fragment>
  );
};

class FAQ extends Component {
  question_and_answer = [
    {
      question: "What?",
      answer: "Hello World"
    },
    {
      question: "What kinds of dogs are there?",
      answer: "Hello World"
    },
    {
      question: "How do you acquire a dog?",
      answer: "Hello World"
    }
  ];

  constructor() {
    super();
    this.state = {
      showConent: true
    };
  }

  fn_toggle = () => {
    this.setState({ showConent: !this.state.showConent });
  };

  render() {
    const { showConent } = this.state;
    return (
      <React.Fragment>
        <Navbar />
        <div className="ui text container">
          <center>
            <h1 className="warranty">FAQ</h1>
            <br />
          </center>
          <Accordion>
            <AccordionItem>
              <AccordionItemHeading>
                <AccordionItemButton>
                  What harsh truths do you prefer to ignore?
                </AccordionItemButton>
              </AccordionItemHeading>
              <AccordionItemPanel>
                <p>
                  Exercitation in fugiat est ut ad ea cupidatat ut in cupidatat
                  occaecat ut occaecat consequat est minim minim esse tempor
                  laborum consequat esse adipisicing eu reprehenderit enim.
                </p>
              </AccordionItemPanel>
            </AccordionItem>
            <AccordionItem>
              <AccordionItemHeading>
                <AccordionItemButton>
                  Is free will real or just an illusion?
                </AccordionItemButton>
              </AccordionItemHeading>
              <AccordionItemPanel>
                <p>
                  In ad velit in ex nostrud dolore cupidatat consectetur ea in
                  ut nostrud velit in irure cillum tempor laboris sed
                  adipisicing eu esse duis nulla non.
                </p>
              </AccordionItemPanel>
            </AccordionItem>
          </Accordion>
        </div>
      </React.Fragment>
    );
  }
}

export default FAQ;
